import React from "react";
import Common from "./Common";
import img1 from "./img1.svg";

const Home = () => {
    return (
        <>
            <Common name="Grow your business with" imgsrc={img1} visit="/services" btnName="Get Started" />
        </>
    );
};

export default Home;
